            TIP_WRITING_MESSAGES_BODY: "자신의 의견과 아이디어를 적는 곳입니다.\n\n멋진 사용을 위해 마크다운 문법을 지원합니다. **강조** 하거나 __밑줄__을 그을 수 있고, 이미지나 파일을 여기에 **드래그 & 드롭** 해서 고양이 GIF같은걸 빠르게 공유 할 수 있습니다. 너무 많이는 말고요.",
